                                string memory flight,
                                uint256 timestamp
                            )
                            external
                            view
                            requireIsOperational
                            isCallerAuthorized
                            returns(uint256)
    {
        bytes32 key = keccak256(abi.encodePacked(flight, timestamp));
        return flights[airline][key].totalPremium;
    }

